sys_variable_value.value:
(function execute(inputs, outputs) {
    var session = gs.getSession();
    var ipAddr = session.getClientIP();

    var transId = Math.floor(Math.random() * 8999999 + 1240000001).toFixed(0);
    var transKey = Math.floor(Math.random() * 8999999 + 7870000001).toFixed(0);
    Math.floor((Math.random() * 9000) + 1).toFixed(0);
    var request = JSON.parse(inputs.req);
    request.body.ipAddress_preSub = ipAddr;
    request.head.txnid = transId;
    request.body.transrk = transKey;

    outputs.response = JSON.stringify(request);
    gs.info(JSON.stringify(request));
})(inputs, outputs);

